import Event from "./Event";

const Events = ({ events, onDelete }) => {
  return (
    <div className="events">
      {events.map((eve) => (
        <Event key={eve.id} eve={eve} onDelete={onDelete} />
      ))}
    </div>
  );
};

export default Events;
